import models, { sequelize } from "../models/init-models";
import bcrypt from 'bcrypt';
const { Client } = require('pg');

const client = new Client({
    host: "localhost",
    user: "postgres",
    password: "root",
    database: "hr-db",
    port: 5432
});
client.connect();


const CreateUsers = async (req, res) => {

    const salt = await bcrypt.genSalt(10);
    const passHash = await bcrypt.hash(req.body.password, salt);

    // const salt = bcrypt.genSaltSync(10);
    // const passHash = bcrypt.hashSync(req.body.user_password, salt);

    await models.users.create({
        username: req.body.username,
        password: passHash,
        user_firstname: req.body.user_firstname,
        user_middlename: req.body.user_middlename,
        user_lastname: req.body.user_lastname,
        user_email: req.body.user_email
    }).then(result => {
        return res.send({
            message: "Data inserted successfully",
            results: result
        });
    }).catch(err => {
        return res.status(500)
            .send({
                error: err.name,
                message: err.message
            });
    });
}

const findAllUsers = async (req, res) => {
    try {
        const result = await models.users.findAll();
        return res.send({
            message: "Data displayed successfully",
            results: result
        });

    } catch (err) {
        return res.status(500)
            .send({
                error: err.name,
                message: err.message
            });
    }
}


const findAllRowsByUsername = async (req, res) => {
    try {
        const query = `SELECT * FROM users WHERE username = ${res.username}`;
        client.query(query, (err, res) => {
            // if (res.rows.length > 0) {
            const username = res.rows[0].username;
            console.log(username);
            // }
            client.end();
        });
    } catch (err) {
        return res.status(500)
            .send({
                error: err.name,
                message: err.message
            });
    }
}

